import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Editor from '@monaco-editor/react';
import API from '../api';

export default function ChallengeDetail() {
    const { id } = useParams();
    const navigate = useNavigate();
    const [chal, setChal] = useState(null);
    const [code, setCode] = useState('# write your solution here');
    const [runOut, setRunOut] = useState({ stdout: '', stderr: '' });
    const [submitMsg, setSubmitMsg] = useState('');

    useEffect(() => {
        API.get(`/api/challenges/${id}`)
            .then(res => setChal(res.data))
            .catch(() => { });
    }, [id]);

    const handleRun = () => {
        setRunOut({ stdout: 'Running…', stderr: '' });
        API.post('/api/run-challenge', { challenge_id: +id, code })
            .then(res => setRunOut(res.data))
            .catch(err =>
                setRunOut({ stdout: '', stderr: err.response?.data?.stderr || 'Error running code' })
            );
    };

    const handleSubmit = async () => {
        setSubmitMsg('Submitting…');
        try {
            const runRes = await API.post('/api/run-challenge', { challenge_id: +id, code });
            setRunOut(runRes.data);
            const out = runRes.data.stdout.trim();
            const subRes = await API.post('/api/submit-challenge', { challenge_id: +id, user_output: out, code });
            setSubmitMsg(`${subRes.data.message} XP: ${subRes.data.xp}, Rank: ${subRes.data.rank}`);
            setChal(prev => ({ ...prev, completed: true }));
        } catch (err) {
            const msg = err.response?.data?.message || err.response?.data?.stderr || 'Error.';
            setSubmitMsg(msg);
        }
    };

    if (!chal) return <p>Loading challenge…</p>;

    return (
        <div className="challenge-detail-page">
            <div className="challenge-detail-card">
                <h1>{chal.title}</h1>
                <p><strong>Input:</strong> {chal.sample_input}</p>
                {chal.completed && <p className="success-message">Already completed!</p>}

                <Editor
                    height="60vh"
                    defaultLanguage="python"
                    value={code}
                    onChange={setCode}
                    theme={document.body.classList.contains('light-mode') ? 'light' : 'vs-dark'}
                />

                {!chal.completed && (
                    <div style={{ margin: '1rem 0' }}>
                        <button className="enter-btn" onClick={handleRun}>Run</button>
                        <button className="enter-btn" onClick={handleSubmit} style={{ marginLeft: '1rem' }}>Submit</button>
                    </div>
                )}

                <div>
                    <h3>Output:</h3>
                    <pre style={{ background: '#111', color: '#fff', padding: '10px', borderRadius: '5px' }}>
                        {runOut.stdout}
                    </pre>
                    {runOut.stderr && (
                        <>
                            <h3 style={{ color: 'red' }}>Errors:</h3>
                            <pre style={{ background: '#300', color: '#f88', padding: '10px', borderRadius: '5px' }}>
                                {runOut.stderr}
                            </pre>
                        </>
                    )}
                </div>

                {submitMsg && (
                    <p className={submitMsg.startsWith('Correct') ? 'success-message' : 'error-message'}>{submitMsg}</p>
                )}
            </div>
        </div>
    );
}
